INSERT INTO `tPlan` VALUES (1,'100%','Plan 100%, financia el total del vehículo hasta en 84 cuotas pero podés adelantar cuotas a \"cuota pura\" y hacer tu plan mas corto. Tenelo desde la cuota 2 por sorteo o licitacion con un ahorro o tu usado. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión.'),(2,'70/30','Plan 70/30, financia el 70% del vehículo hasta en 84 cuotas pero podés adelantar cuotas a \"cuota pura\" y hacer tu plan mas corto. Tenelo desde la cuota 2 por sorteo o licitacion con un ahorro o tu usado. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión.'),(3,'60/40','Plan 60/40, financia el 60% del vehículo hasta en 84 cuotas pero podés adelantar cuotas a \"cuota pura\" y hacer tu plan mas corto. Tenelo desde la cuota 2 por sorteo o licitacion con un ahorro o tu usado. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión.'),(4,'75/25','Plan 75/25, financia el 75% del vehículo hasta en 84 cuotas y podés adelantar cuotas a \"cuota pura\" (sin interés) y hacer tu plan mas corto. Tenelo desde la cuota 2 por sorteo o licitación con un ahorro o tu usado.'),(5,'50/50','Plan 50/50, financia el 50% del vehículo hasta en 84 cuotas pero podés adelantar cuotas a \"cuota pura\" y hacer tu plan mas corto. Tenelo desde la cuota 2 por sorteo o licitacion con un ahorro o tu usado. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión.');
/*!40000 ALTER TABLE `tPlan` ENABLE KEYS */;
