INSERT INTO `tPlanAC` VALUES (1,'100%','Plan 100% ADJUDICADO, financia el el total de la unidad hasta en 84 cuotas. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión; la cuota pura permite adelantar o cancelar cuotas. Retira el vehículo y continúa con el plan, abonando las cuotas restantes.\r\n'),(2,'70/30','Plan 70/30 ADJUDICADO, financia el 70% de la unidad hasta en 84 cuotas. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión; la cuota pura permite adelantar o cancelar cuotas. Retira el vehículo (Integrando el 30%) y continúa con el plan, abonando las cuotas restantes.\r\n'),(3,'60/40','Plan 60/40, financia el 60% de la unidad hasta en 84 cuotas, y el 40% se integra al retirar. permite adjudicar desde la cuota 2 por sorteo y liciación. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión; la cuota pura permite adelantar o cancelar cuotas.'),(4,'75/25','Plan 75/25, financia el 75% de la unidad hasta en 84 cuotas, y el 25% se integra al retirar. permite adjudicar desde la cuota 2 por sorteo y liciación. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión; la cuota pura permite adelantar o cancelar cuotas.'),(5,'50/50','Plan 50/50, financia el 50% de la unidad hasta en 84 cuotas, y el 50% se integra al retirar. permite adjudicar desde la cuota 2 por sorteo y liciación. Las cuotas incluyen seguro de vida, gastos, sellados, impuestos y derecho de admisión; la cuota pura permite adelantar o cancelar cuotas.');
/*!40000 ALTER TABLE `tPlanAC` ENABLE KEYS */;
